import{ React,useState, useEffect} from 'react'
import CommercePropertyBox from '../CommercePropertyBos'
import axios from 'axios';
import properties from '../../properties'


 const CommerceProperty = ({title}) => {

    const [fetchProperties, setFetchProperties] = useState([]);


    useEffect(() => {
       getData();

    }, [])

   async function getData(fetch) {
       const propertiesResult = await axios.get(properties.properties_list_url);
       console.log(propertiesResult);
       setFetchProperties(propertiesResult.data.data);
   }

    return (
        <div>
             <div className="text20">
         <h2 >{title}
        </h2><a href="#" ><span className="view1">View all</span></a></div>
        <div className="container1">
        <CommercePropertyBox  
        link="index.html" 
        image="images/bg_1.jpeg" 
        title="Office Inspection" 
        title1="Make sure you're getting what your Office promised"
        />
        <CommercePropertyBox
        link="index.html" 
        image="images/bg_1.jpeg" 
        title="Building Inspection" 
        title1="Make sure you're getting what your builder promised"
        />
        <CommercePropertyBox
        link="index.html" 
        image="images/bg_1.jpeg" 
        title="Guest house Inspection" 
        title1="Make sure you're getting what your Guest house promised"
        />

</div>

        </div>
    )
    }
export default CommerceProperty;
